import axios from "axios"
import { useState, useEffect } from "react"
import Post from "./post"

export default function Home() {
    const [posts, setPosts] = useState([])
    const [author, setAuthor] = useState("")

    function getPosts() {
        axios({
            method: "GET",
            url: "/api/posts/"
        }).then((response) => {
            const newposts = response.data
            setPosts(newposts)
        })
    }
    function getAuthor(pk) {
        axios({
            method: "GET",
            url: "/api/users/".concat(pk)
        }).then((response) => {
            setAuthor(response.data)
        })
        return author
    }
    useEffect(getPosts, [])

    const x = posts.filter(post => post.publicationDate != null)
    const elements = x.map(post => <Post publicationDate={post.publicationDate}  pb={post.publicationShortDate} pk={post.pk} title={post.title} author = {getAuthor(post.author)} authorpk={post.author}  text={post.text} />)

    return (
        <div className="content">
            {elements}
        </div>
    )
}
